releases/0/tender/description:
The scope of the works is for the construction of a new shielded Intermediate Level Waste (ILW) Drum Store Extension and an Unshielded Waste Store Extension for shielded waste containers to the existing Dounreay Cementation Plant (DCP) complex comprising of:

Procurement and construction of a large scale reinforced concrete store, construction of a fully clad portal framed 'lean to' structure with integral shield wall, substructure and external walls to provide the required radiological shielding;
Take on the role of Principal Contractor and establish a Delineated Site to control access and egress to the works and where all work activities are covered by the Contractor's safe systems of work;
Electrical and Mechanical installation works for the Stores and interfaces with the existing DCP Import Export Facility;
Procurement, manufacture and installation of shielded doors;
Procurement, manufacture, testing and installation of a lid lifting hoist;
Procurement, manufacture, testing and delivery of a modified 65 tonne bogie and rail system;
Provision of a control room that incorporates the electrical, control and instrument interfaces between the various systems in the new shielded ILW store extension;
Heating, Ventilation & Air Conditioning systems for the Stores;
Interactions with the Contractor appointed for the design, supply and installation of the facility cranes; and
Functional Testing (Setting to Work) of the new ILW store extensions, covering all plant & equipment including the compilation of all testing / commissioning procedures / instructons to the satisfaction / prior approval of the Employer's nominated representative.  All testing carried out via a combination of Factory Acceptance Tests (FATs), Site Acceptance Tests (SATs) and Plant Walkdown Inspections (PWDS) as appropriate.
